const Instacontact = () => {
    return (
<div className="Instacontact">
    <h2>Retrouvez-moi sur Instagram</h2>
    <div className="conteneurinsta">
        <a href="https://www.instagram.com/p/CyDTINVsr3R/" target="_blank"><img src='https://i.goopics.net/dn7kpy.png' className="insta1" alt=" Instagram 1"/></a>
        <a href="https://www.instagram.com/p/CyDTINVsr3R/" target="_blank"></a><img src='https://i.goopics.net/s8v5pw.png'className="insta2" alt=" Instagram 2" />
        <a href="https://www.instagram.com/p/CyDTINVsr3R/" target="_blank"></a><img src='https://i.goopics.net/pdtpyh.png'className="insta3" alt=" Instagram 3"/>
        <a href="https://www.instagram.com/p/CyDTINVsr3R/" target="_blank"></a><img src='https://i.goopics.net/5ek98q.png'className="insta4" alt=" Instagram 4"/>
        <a href="https://www.instagram.com/p/CyDTINVsr3R/" target="_blank"></a><img src='https://i.goopics.net/dc2jx8.png'className="insta5" alt=" Instagram 5"/>
        <img src='https://i.goopics.net/htc722.png'className="insta6" alt=" Instagram 6"/>
    </div>
</div>
    );
  };
  
  export default Instacontact;
